import './Header.css';
import { Link } from "react-router-dom";
import React from 'react';

class Header extends React.Component
{
    constructor(props) {
        this.onClick = this.onClick.bind(this);
    }

    onClick(e)
    {
        let navToggle = document.querySelector(".nav__toggle");
        let navWrapper = document.querySelector(".nav__wrapper");
        if (navWrapper.classList.contains("active")) {
          this.setAttribute("aria-expanded", "false");
          this.setAttribute("aria-label", "menu");
          navWrapper.classList.remove("active");
        } else {
          navWrapper.classList.add("active");
          this.setAttribute("aria-label", "close menu");
          this.setAttribute("aria-expanded", "true");
        }
    }

    render()
    {
        return (
            <header className="site-header">
              <div className="wrapper site-header__wrapper">
                  <div className="site-header__start">
                    {/* <a href="{{ url_for('main.index') }}" className="navbar-brand">
                      <img src="{{ url_for('static',filename='images/logo.png') }}">
                    </a> 
                    */}
                  </div>
                  <div className="site-header__middle">
                      <nav className="nav">
                          <button className="nav__toggle" aria-expanded="false" type="button">Меню</button>
                            <ul className="nav__wrapper">
                                <li className="nav__item">
                                    <a href="{{ url_for('main.index') }}">Главная страница</a>
                                </li>
                                <li className="nav__item">
                                    <a href="{{ url_for('main.news',page=1) }}">Новости</a>
                                </li>
                                <li className="nav__item">
                                    <a href="{{ url_for('main.profile') }}">Профиль</a>
                                </li>
                            </ul>
                      </nav>
                  </div>
                  <div className="site-header__end">
                            <a className="button" href="{{ url_for('main.add_post') }}">Добавить пост</a>
                            <a className="button" href="{{ url_for('main.control_users') }}">Управления пользователями</a>
                      <a className="button" href="{{ url_for('auth.logout') }}">Выйти из аккаунта</a>
                      <a className="button" href="{{ url_for('auth.login') }}">Войти</a>
                      <a className="button" href="{{ url_for('auth.signup') }}">Зарегистрироваться</a>
                  </div>
              </div>
              </header>
          );
    }
}

export default Header;
